import { createActions } from "redux-actions";

export const getType = (ReduxActions) => {
  return ReduxActions().type;
};

export const getJars = createActions({
  getJarsRequest: undefined,
  getJarsSuccess: (payload) => payload,
  getJarsFailure: (payload) => payload,
});

export const createJar = createActions({
  createJarRequest: (payload) => payload,
  createJarSuccess: (payload) => payload,
  createJarFailure: (payload) => payload,
});
